import './BgimgStyles.css'

import React from 'react'

const Bgimg = () => {
  return (
    <div className='bgimg'>
      <div className='heading'>
        <h1>Heading</h1>
        <p>Text</p>
      </div>
    </div>
  )
}

export default Bgimg
